insert into `command` (`args`, `bot_id`, `guild_id`, `id`, `name`, `time`, `user_id`) values ('Impara\nPenso al futuro ma vivo il presente\nNon ha senso fare progetti se non sai fare niente\nFino a ieri annegavo tra i dubbi, le mie insicurezze\nMi hanno imparato a trasformare i sogni in certezze\nHo scoperto il rap da poco\nOra lo scrivo come se fosse un gioco\nSfodero un sorriso davanti all\'obiettivo, scelgo una posa e metto a fuoco\nE\' bello pensare a quanto è facile sfondare\nNel mondo della musica non ricevi senza dare\nAccendi la radio senti una canzone\nHai l\'impressione che anche per te ci sia un\'occasione\nMa non serve a nulla il talento se c\'è corruzione\nLa Mafia è un vulcano in continua eruzione\nEhy...\nEhy...\nVedi cio che vuoi ma la realtà è diversa\nSe pensi che si avrà giustizia è una scommessa persa\nNon c\'è bisogno che mi ringrazi, per me è un passatempo\nIn futuro sarà un lavoro, perchè continuo a crederci e non penso al tempo\nOra, se vuoi essere onesto dammi ciò che mi spetta\nPerchè prima degli altri ho raggiunto la vetta', '983315338886279229', '474935164451946506', 5035, 'tts', '2023-11-20 22:41:32', '383358222972616705');
